  [],\n\t\"revision_timestamp\": \"2015-07-08T19:23:12.885510\",\n\t\"name\": \"uars-wind-imaging-interferometer-windii-level-3at-v001\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Wind Imaging Interferometer (WINDII)
  Level 3AT data product consists of daily, 65.536 second interval time-ordered vertical
  profiles of meridional and zonal wind components, and temperature. The instrument
  was a Michelson interferometer designed to measure Doppler shifts of spectral lines
  in the visible between 550 and 780 nm.  WINDII was flown on NASA's Upper Atmosphere
  Research Satellite (UARS) and designed to measure wind, temperature and emission
  rates in the mesosphere and thermosphere between 80 and 300 km at about 5 km resolution.
  Data were collected between latitude 40S and 72N and 72S and 40N, alternating each
  satellite yaw cycle of about 36 days. The WINDII Level 3AT data were processed with
  the version 11 algorithm.nnThe WINDII level 3AT product consists of 3 granules per
  day. A data granule is one WINDII species or subtype per day.  The following subtypes
  are available:nn 1) MERWIN_A - meridional wind component on altitude grid  [m/s]n
  2) ZONWIN_A - zonal wind component on altitude grid       [m/s]n 3) TEMP - temperature
  on altitude grid                    [Kelvin]nnWINDII data are on the UARS standard
  altitude levels (in km) given by:nnz(i) = 5*i                 for  1 <= i <= 12nz(i)
  = 60 + (i-12)*3       for 13 <= i <= 32nz(i) = 120 + (i-32)*5      for 33 <= i <=
  88nnEach of the 3 WINDII granules is accompanied by an additional parameter file,
  designated as level 3TP.  The parameter file, contains additional ancillary and
  quality information not found in the 3AT files.  The data files are available in
  a binary record oriented format.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
